import { Link } from "react-router-dom";
const MainPage = () => {
  return (
    <div>
    <nav>
      <ul>
        <li>
          <Link to="/welcome"> Welcome Page by Link</Link>
        </li>

        <li>
          <Link to="/product"> Product Page by Link</Link>
        </li>
      </ul>
    </nav>
    </div>
  );
};

export default MainPage;
